/**
 *  Make dropdown open/close when click trigger
 */
(function dropdown ($) {

    $(window).ready(init);

    var WIDGET_SEL = '[data-widget~="Dropdown"]';
    var WIDGET_TRIGGER_SEL = '[data-widget~="Dropdown-trigger"]';
    var WIDGET_STATE_ATTR = 'data-widget-state';

    function init() {


        var widget = $(WIDGET_SEL);
        if (widget.length === 0) {
            return;
        }

        widget
            .attr(WIDGET_STATE_ATTR,'close')
            .on('click',WIDGET_TRIGGER_SEL, toggleWidget);

        $('body').on('click', function(event) {
            var target = $(event.target);
            if (target.parents(WIDGET_SEL).length == 0) {
                $(WIDGET_SEL).attr(WIDGET_STATE_ATTR,'close');
            }
        });

    }

    function toggleWidget(event) {
        event.preventDefault();
        var widget = $(event.currentTarget).parent();
        widget
            .attr(WIDGET_STATE_ATTR, widget.attr(WIDGET_STATE_ATTR) == 'open' ? 'close' : 'open')
            .siblings().attr(WIDGET_STATE_ATTR,'close');
    }

}(jQuery));

