/**
 *  Make dropdown open/close menu
 *  hover for desktop
 *  click for burger menu
 *  don't manage window resize because case is not usually
 */



(function mainnav ($) {




    var MAINNAV = '[data-widget~="DropdownNav"]';
    var MAINNAVITEMHOVER = '.MainNav-list > li';
    var MAINNAVITEMCLICK = '[data-widget-hasChild] > a';




    $(window).ready(function() {

        init();

        if (window.matchMedia("(min-width: 960px)").matches) {
            init_desktop();
        } else {
            init_tablet_phone();
        }

    });

    $( window ).on( "orientationchange", function( event ) {
        if (window.matchMedia("(min-width: 960px)").matches) {
            init_desktop();
        } else {
            init_tablet_phone();
        }
    });




    function init() {

        var mainNavitemHasChild = $(MAINNAV).find('li:not(li li li)');;

        $(mainNavitemHasChild).each(function(index, el) {  
            var $this = $(this);
            if( $this.children().length > 1 ){
                $this.attr('data-widget-hasChild', '' );
            }
        });
    }

    function init_desktop() {
        $(MAINNAV).on('mouseenter',MAINNAVITEMHOVER, showWidget);
        $(MAINNAV).on('mouseleave', MAINNAVITEMHOVER, hideWidget);
    }

    function init_tablet_phone() {
        $(MAINNAV).on('click',MAINNAVITEMCLICK, toggleWidget);
    }




    function showWidget(event) {
        var $widget = $(event.currentTarget)
        $widget
            .attr('data-widget-state', 'open' )
            .siblings().attr('data-widget-state','close');
    }
    function hideWidget(event) {
        var $widget = $(event.currentTarget);
        $widget
            .attr('data-widget-state', 'close' )
            .siblings().attr('data-widget-state','close');
    }

    function toggleWidget(event) {
        event.preventDefault();
        var $widget = $(event.currentTarget).parent();
        $widget
            .attr('data-widget-state', $widget.attr('data-widget-state') == 'open' ? 'close' : 'open')
    }




}(jQuery));
