/**
 *  Init popup gallery in Wysiwyg contents
 */
(function popupGallery ($) {


    var POPUP_BUTTON = '.PopupLink--gallery';
    var POPUP_CONTAINER = '.mfp-container';
    var PLAY_BUTTON = '<button class="mfp-diaporama mfp-diaporama--play mfp-prevent-close">play</button>';
    var STOP_BUTTON = '<button class="mfp-diaporama mfp-diaporama--stop mfp-prevent-close">stop</button>';
    var PLAY_BUTTON_SEL = '.mfp-diaporama--play';
    var STOP_BUTTON_SEL = '.mfp-diaporama--stop';

    var slideshow = '';


    $(window).ready(init);

    function init() {

        var groups = {};
        $(POPUP_BUTTON).each(function() {
            var id = parseInt($(this).attr('data-group'), 10);

            if(!groups[id]) {
                groups[id] = [];
            }

            groups[id].push( this );
        });


        $.each(groups, function() {

            $(this).magnificPopup({
                type: 'image',
                closeOnContentClick: true,
                closeBtnInside: false,
                gallery: { enabled:true },
                image: {
                    titleSrc: function (item) {
                        return item.el.attr('mfp-caption');
                    }
                },
                callbacks: {
                    open: initSlideshow,
                    close: stopSlideshow,
                    imageLoadComplete: styleSlideshow,
                }
            })

        });
    }

    function initSlideshow() {
        var magnificPopup = $.magnificPopup.instance;
        $(POPUP_CONTAINER)
            .on('click', PLAY_BUTTON_SEL, startSlideshow)
            .on('click', STOP_BUTTON_SEL, stopSlideshow)
            .append(PLAY_BUTTON)
            .append(STOP_BUTTON);
    }

    function startSlideshow(event) {
        clearInterval(slideshow);
        slideshow = setInterval(function(){
            $.magnificPopup.instance.next();
        }, 2000);
    }

    function stopSlideshow(event) {
        clearInterval(slideshow);
    }

    function styleSlideshow(event) {
        var magnificPopup = $.magnificPopup.instance;
        var popupWidth = magnificPopup.st.el.context.dataset.popupWidth;
        var popupHeight = magnificPopup.st.el.context.dataset.popupHeight;
        if(popupWidth>0 && popupWidth<$('.mfp-img').css('max-width')){
            $('.mfp-img').css('max-width',popupWidth+'px');
        }
        if(popupHeight>0 && popupHeight<$('.mfp-img').css('max-height')){
            $('.mfp-img').css('max-height',popupHeight+'px');
        }
    }


}(jQuery));


/**
 *  Init AJAX popup
 */
(function popupImage ($) {


    var POPUP_BUTTON = '.PopupLink';

    $(window).ready(init);

    function init() {

        var widget = $(POPUP_BUTTON).not('.PopupLink--simple').not('.PopupLink--image').not('.PopupLink--gallery');
        if (widget.length === 0) {
            return;
        }

        widget.each(function(){
            $(this).attr('href',$(this).attr('data-href'));
        });

        widget.magnificPopup({
            closeOnContentClick: true,
            closeBtnInside: false,
            type: 'ajax',
            alignTop: true,
            overflowY: 'scroll',
            callbacks: {
                ajaxContentAdded: function() {
                    var magnificPopup = $.magnificPopup.instance;
                    var mypopup = $('#popup');
                    mypopup.css('background-color','white').css('margin','30px auto 0').css('padding','0 5px');
                    $("#popup:has(img)").filter(function() {
                        if ($(this).children().length ===1){
                            childs = $.parseHTML($(this).html().trim());
                            if(childs.length === 1){
                                $("#popup img").addClass("mfp-img")
                                    .parent().css('background-color','transparent')
                                    .parent().parent().addClass('mfp-image-holder')
                                    .parent().removeClass('mfp-align-top');
                                return true;
                            }
                            return false;
                        }
                    });

                    if (typeof magnificPopup.currItem.el.context.dataset.popupWidth !== "undefined") {
                        mypopup.css('max-width',magnificPopup.currItem.el.context.dataset.popupWidth+'px');
                    }else{
                        mypopup.css('max-width','900px');
                    }
                    if (typeof magnificPopup.currItem.el.context.dataset.popupHeight !== "undefined") {
                        mypopup.css('max-height',magnificPopup.currItem.el.context.dataset.popupHeight+'px');
                    }
                }
            }
        })

    }


}(jQuery));

